  }

  return (
    <div className={styles.Container}>
      <div className={styles.listCartItem}>
        {arrCourses?.length > 0 ? <ul className="row">
          <li>
            <p className={styles.tenKhoaHocHeader}>Categories name</p>
            <p className={styles.trashHeader}> </p>
          </li>
          {arrCourses.map((item) => (
            <li>
              <p className={styles.tenKhoaHoc}>{item.tenKhoaHoc}</p>
              <a
                href
                onClick={() => handleDeleteClick(item)}
              >
                <img
                  src={trash}
                  alt="logo"
                />
              </a>
            </li>
          ))}
        </ul>
          : <p className={styles.notiEmptyCart}>There is no categories</p>}

